import React from 'react';

export default class Genres extends React.Component{
    render(){
        return(
            <div id="categories" className="widget">
                <h2 className="widget-title">Genres</h2>
                {this.props.genres.map((genre,index)=>
                <ul key={index}>
                    <li><a href="/"> {genre}</a> </li>
                </ul>)}
            </div>
        );
    }

}
